import { Container } from './styles';
import logo from '../../images/logo.svg';
import Button from '../Button';


function Header() {
  return (
    <Container>
       <img src={logo} alt="Logo Happy Pet" />
       <Button href="#">Start</Button>
    </Container>
  );
};

export default Header;
